import React from 'react';

class Index extends React.Component{
    render(){
        return(
            <React.Fragment>
                <h1>This is the Index Page</h1>  
                <a href="/"> Home </a>  
                <a href="/about"> About </a>  
                <a href="/blog"> Blog </a>  
                <a href="/cv"> CV </a>  
                <a href="/portfolios"> Portfolios </a>  
            </React.Fragment>   
        )
    }
}

export default Index
